  methods: {
    handleCompare: function handleCompare() {
      if (!this.selectionRows || this.selectionRows.length != 2) {
        this.openNotifIcon('请选择两条数据');
        return false;
      } else if (this.selectionRows[0].dataId != this.selectionRows[1].dataId) {
