        return false;
      } else {
        this.$refs.modalForm.addModal(this.selectionRows);
        this.$refs.modalForm.title = "数据比较";
      }
    },
    openNotifIcon: function openNotifIcon(msg) {
      this.$notification['warning']({
        message: '提示信息',
        description: msg
      });
    }
  }
};
